const express = require("express");
const pool = require("../../config/db");
const router = express.Router();

const PdfPrinter = require("pdfmake");
const fs = require("fs");
const path = require("path");

const ExcelJS = require("exceljs");

router.get("/no-reinscritos", async (req, res) => {
  const { gestion, sucursal, curso, page = 1, pageSize = 10 } = req.query;

  if (!gestion || !sucursal || !curso || curso === "Todos los Cursos") {
    return res
      .status(400)
      .json({ error: "Filtros incompletos o no permitidos para vista previa" });
  }

  const offset = (page - 1) * pageSize;
  const gestionAnterior = parseInt(gestion) - 1;

  try {
    // Obtener IDs de estudiantes inscritos el año anterior en ese curso y sucursal
    const inscritosAnterior = await pool.query(
      `SELECT estudiante_id
         FROM inscripciones
         WHERE gestion = $1 AND sucursal = $2 AND curso = $3`,
      [gestionAnterior, sucursal, curso]
    );

    const ids = inscritosAnterior.rows.map((row) => row.estudiante_id);

    if (ids.length === 0) {
      return res.json({ total: 0, estudiantes: [] });
    }

    // Filtrar los que NO tienen inscripcion en la gestion actual
    const totalResult = await pool.query(
      `SELECT COUNT(*) as total
         FROM estudiantes e
         WHERE e.id = ANY($1)
         AND NOT EXISTS (
           SELECT 1 FROM inscripciones i
           WHERE i.estudiante_id = e.id AND i.gestion = $2
         )`,
      [ids, gestion]
    );

    const total = parseInt(totalResult.rows[0].total);

    const result = await pool.query(
      `SELECT 
           e.cod_est,
           e.carnet_identidad,
           e.apellidop,
           e.apellidom,
           e.nombre
         FROM estudiantes e
         WHERE e.id = ANY($1)
         AND NOT EXISTS (
           SELECT 1 FROM inscripciones i
           WHERE i.estudiante_id = e.id AND i.gestion = $2
         )
         ORDER BY e.apellidop
         LIMIT $3 OFFSET $4`,
      [ids, gestion, pageSize, offset]
    );

    res.json({
      total,
      estudiantes: result.rows,
    });
  } catch (error) {
    console.error("❌ Error obteniendo estudiantes no reinscritos:", error);
    res.status(500).json({ error: "Error en el servidor" });
  }
});

//DESCARGAR PDF
const fonts = {
  Roboto: {
    normal: path.join(__dirname, "../../fonts/Roboto-Regular.ttf"),
    bold: path.join(__dirname, "../../fonts/Roboto-Bold.ttf"),
    italics: path.join(__dirname, "../../fonts/Roboto-Italic.ttf"),
    bolditalics: path.join(__dirname, "../../fonts/Roboto-BoldItalic.ttf"),
  },
};

const printer = new PdfPrinter(fonts);

router.get("/no-reinscritos/pdf", async (req, res) => {
  const { gestion, sucursal, curso } = req.query;

  if (!gestion || !sucursal || !curso) {
    return res.status(400).json({ error: "Faltan filtros requeridos" });
  }

  const cursosPrimaria = [
    "Maternal",
    "Pre-Kinder",
    "Kinder",
    "Primero",
    "Segundo",
    "Tercero",
    "Cuarto",
    "Quinto",
    "Sexto",
  ];
  const cursosSecundaria = [
    "Primero",
    "Segundo",
    "Tercero",
    "Cuarto",
    "Quinto",
    "Sexto",
  ];
  const cursos = sucursal === "Primaria" ? cursosPrimaria : cursosSecundaria;
  const gestionAnterior = parseInt(gestion) - 1;

  try {
    const content = [
      {
        columns: [
          {
            image:
              "data:image/png;base64,",
            width: 80,
          },
          {
            text: "ESTUDIANTES QUE NO SE REINSCRIBIERON",
            alignment: "center",
            fontSize: 18,
            bold: true,
            margin: [0, 15, 0, 0],
          },
        ],
      },
      {
        text: `\nGestión: ${gestion}   |   Sucursal: ${sucursal}   |   Curso: ${curso}`,
        style: "filtros",
        margin: [0, 10, 0, 20],
      },
    ];

    if (curso !== "Todos los Cursos") {
      const estudiantes = await obtenerNoReinscritos(
        gestion,
        gestionAnterior,
        sucursal,
        curso
      );
      content.push(generarTabla(estudiantes));
    } else {
      for (const c of cursos) {
        const estudiantes = await obtenerNoReinscritos(
          gestion,
          gestionAnterior,
          sucursal,
          c
        );
        if (estudiantes.length > 0) {
          content.push({
            text: `\nCurso: ${c}`,
            style: "cursoTitulo",
            margin: [0, 20, 0, 10],
          });
          content.push(generarTabla(estudiantes));
        }
      }
    }

    const docDefinition = {
      content,
      styles: {
        filtros: {
          bold: true,
          fontSize: 12,
          alignment: "center",
        },
        tableHeader: {
          bold: true,
          fontSize: 11,
          color: "#1e3a8a",
          alignment: "center",
        },
        cursoTitulo: {
          bold: true,
          fontSize: 14,
          color: "#1f2937",
          alignment: "left",
        },
      },
      defaultStyle: {
        font: "Roboto",
      },
      pageOrientation: "portrait",
      pageSize: "A4",
      pageMargins: [40, 60, 40, 60],
    };

    const pdfDoc = printer.createPdfKitDocument(docDefinition);
    res.setHeader("Content-Type", "application/pdf");
    res.setHeader(
      "Content-Disposition",
      "attachment; filename=reporte-no-reinscritos.pdf"
    );
    pdfDoc.pipe(res);
    pdfDoc.end();
  } catch (error) {
    console.error("❌ Error generando PDF:", error);
    res.status(500).json({ error: "Error al generar el PDF" });
  }
});

async function obtenerNoReinscritos(
  gestionActual,
  gestionAnterior,
  sucursal,
  curso
) {
  const inscritosAnterior = await pool.query(
    `SELECT estudiante_id FROM inscripciones WHERE gestion = $1 AND sucursal = $2 AND curso = $3`,
    [gestionAnterior, sucursal, curso]
  );

  const ids = inscritosAnterior.rows.map((row) => row.estudiante_id);
  if (ids.length === 0) return [];

  const result = await pool.query(
    `SELECT 
         e.cod_est,
         e.carnet_identidad,
         e.apellidop,
         e.apellidom,
         e.nombre
       FROM estudiantes e
       WHERE e.id = ANY($1)
       AND NOT EXISTS (
         SELECT 1 FROM inscripciones i WHERE i.estudiante_id = e.id AND i.gestion = $2
       )
       ORDER BY e.apellidop`,
    [ids, gestionActual]
  );

  return result.rows;
}

function generarTabla(estudiantes) {
  return {
    table: {
      widths: [20, "*", "*", "*", "*", "*"],
      body: [
        [
          { text: "#", style: "tableHeader" },
          { text: "Código", style: "tableHeader" },
          { text: "CI", style: "tableHeader" },
          { text: "Apellido Paterno", style: "tableHeader" },
          { text: "Apellido Materno", style: "tableHeader" },
          { text: "Nombre", style: "tableHeader" },
        ],
        ...estudiantes.map((est, index) => [
          { text: index + 1, alignment: "center" },
          { text: est.cod_est, alignment: "center" },
          { text: est.carnet_identidad, alignment: "center" },
          { text: est.apellidop, alignment: "center" },
          { text: est.apellidom, alignment: "center" },
          { text: est.nombre, alignment: "center" },
        ]),
      ],
    },
    layout: {
      fillColor: (rowIndex) => (rowIndex === 0 ? "#e2e8f0" : null),
      hLineWidth: () => 0.5,
      vLineWidth: () => 0.5,
      hLineColor: () => "#cbd5e0",
      vLineColor: () => "#cbd5e0",
    },
    margin: [0, 0, 0, 20],
  };
}

//DESCARGAR EXCEL
router.get("/no-reinscritos/excel", async (req, res) => {
  const { gestion, sucursal, curso } = req.query;

  if (!gestion || !sucursal || !curso) {
    return res.status(400).json({ error: "Faltan filtros requeridos" });
  }

  const gestionAnterior = parseInt(gestion) - 1;
  const workbook = new ExcelJS.Workbook();
  const worksheet = workbook.addWorksheet("No reinscritos");

  const cursosPrimaria = [
    "Maternal",
    "Pre-Kinder",
    "Kinder",
    "Primero",
    "Segundo",
    "Tercero",
    "Cuarto",
    "Quinto",
    "Sexto",
  ];
  const cursosSecundaria = [
    "Primero",
    "Segundo",
    "Tercero",
    "Cuarto",
    "Quinto",
    "Sexto",
  ];
  const cursos =
    curso === "Todos los Cursos"
      ? sucursal === "Primaria"
        ? cursosPrimaria
        : cursosSecundaria
      : [curso];

  try {
    // Título
    worksheet.mergeCells("A1:F1");
    worksheet.getCell("A1").value =
      "REPORTE DE ESTUDIANTES QUE NO SE REINSCRIBIERON";
    worksheet.getCell("A1").font = { size: 16, bold: true };
    worksheet.getCell("A1").alignment = { horizontal: "center" };

    // Subtítulo
    worksheet.mergeCells("A2:F2");
    worksheet.getCell(
      "A2"
    ).value = `Gestión: ${gestion} | Sucursal: ${sucursal} | Curso: ${curso}`;
    worksheet.getCell("A2").font = { italic: true, bold: true };
    worksheet.getCell("A2").alignment = { horizontal: "center" };

    let currentRow = 4;

    for (const c of cursos) {
      // Buscar inscripciones del año anterior
      const inscritosAnterior = await pool.query(
        `SELECT estudiante_id
           FROM inscripciones
           WHERE gestion = $1 AND sucursal = $2 AND curso = $3`,
        [gestionAnterior, sucursal, c]
      );

      const ids = inscritosAnterior.rows.map((r) => r.estudiante_id);
      if (ids.length === 0) continue;

      const result = await pool.query(
        `SELECT cod_est, carnet_identidad, apellidop, apellidom, nombre
           FROM estudiantes
           WHERE id = ANY($1)
           AND NOT EXISTS (
             SELECT 1 FROM inscripciones
             WHERE estudiante_id = estudiantes.id AND gestion = $2
           )
           ORDER BY apellidop`,
        [ids, gestion]
      );

      const estudiantes = result.rows;
      if (estudiantes.length === 0) continue;

      if (curso === "Todos los Cursos") {
        worksheet.mergeCells(`A${currentRow}:F${currentRow}`);
        worksheet.getCell(`A${currentRow}`).value = `Curso: ${c}`;
        worksheet.getCell(`A${currentRow}`).font = { bold: true };
        worksheet.getCell(`A${currentRow}`).alignment = { horizontal: "left" };
        currentRow++;
      }

      // Encabezado de tabla
      const headerRow = worksheet.insertRow(currentRow, [
        "#",
        "Código",
        "CI",
        "Apellido Paterno",
        "Apellido Materno",
        "Nombre",
      ]);
      headerRow.font = { bold: true, color: { argb: "FFFFFFFF" } };
      headerRow.alignment = { horizontal: "center" };
      headerRow.eachCell((cell) => {
        cell.fill = {
          type: "pattern",
          pattern: "solid",
          fgColor: { argb: "2563EB" },
        };
        cell.border = {
          top: { style: "thin" },
          left: { style: "thin" },
          bottom: { style: "thin" },
          right: { style: "thin" },
        };
      });
      currentRow++;

      // Datos
      estudiantes.forEach((est, index) => {
        const row = worksheet.insertRow(currentRow, [
          index + 1,
          est.cod_est,
          est.carnet_identidad,
          est.apellidop,
          est.apellidom,
          est.nombre,
        ]);
        row.alignment = { horizontal: "center" };
        row.eachCell((cell) => {
          cell.border = {
            top: { style: "thin" },
            left: { style: "thin" },
            bottom: { style: "thin" },
            right: { style: "thin" },
          };
        });
        currentRow++;
      });

      currentRow++;
    }

    // Ajuste de columnas
    worksheet.columns.forEach((col) => (col.width = 20));

    // Footer
    worksheet.addRow([]);
    worksheet.addRow([]);
    const fecha = worksheet.addRow([
      `Generado el ${new Date().toLocaleDateString()}`,
    ]);
    fecha.getCell(1).alignment = { horizontal: "center" };
    fecha.getCell(1).font = {
      italic: true,
      size: 10,
      color: { argb: "888888" },
    };
    worksheet.mergeCells(`A${fecha.number}:F${fecha.number}`);

    const firma = worksheet.addRow(["Firma: ____________________________"]);
    firma.getCell(1).alignment = { horizontal: "left" };
    firma.getCell(1).font = { italic: true, size: 10 };
    worksheet.mergeCells(`A${firma.number}:F${firma.number}`);

    // Descargar
    res.setHeader(
      "Content-Type",
      "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"
    );
    res.setHeader(
      "Content-Disposition",
      `attachment; filename=no-reinscritos-${gestion}-${sucursal}-${curso}.xlsx`
    );

    await workbook.xlsx.write(res);
    res.end();
  } catch (error) {
    console.error("❌ Error generando Excel de no reinscritos:", error);
    res.status(500).json({ error: "Error al generar el Excel" });
  }
});

module.exports = router;
